import React from 'react';
import axios from 'axios';
import User from './user';

function App(){
    const [users, setUsers] = React.useState([]);
    React.useEffect(function(){
        async function fetchAllUsers(){
            const res = await axios.get('http://localhost:8800/users');
            setUsers(res.data);
        }
        fetchAllUsers();
    },[])

    const usersElements = getUsers();

    function getUsers(){
        if(users){
            users.map(
                user=>{
                    return(
                        <User
                            key = {user.userid}
                            {...user}
                        />
                    )
                }
            )
        }else{
            return <p>hello</p>
        }
    }
    
    return(
        <div key = "abcd">
            {usersElements}
        </div>
    )
}
export default App;
